<!DOCTYPE html>
<html lang="en">
<head>
    <meta charset="UTF-8">
    <meta name="viewport" content="width=device-width, initial-scale=1.0">
    <style>
        /* Button style */
        .custom-button {
            background-color: #33b5fd;
            color: #fff;
            padding: 10px 15px;
